import express from "express";
import cors from "cors";
import mysql from "mysql2";

const app = express();
const port = 5000;
app.use(cors());
app.use(express.json());

const db = mysql.createConnection({
    host:"localhost",
    user: "root",
    password: "password",
    databse: "todoapp"
});

db.connect((err) => {
    if (err) throw err;
    console.log("connected to database")
}
);












app.listen()
